import {useNavigate} from "react-router-dom";

export const HomePage = () => {
    const navigate =useNavigate()

    const voltar = () => {

        navigate(-1)
    }
    return (
        <div>
            <p>ListTripsPage</p>
            <button onClick={voltar}>Voltar</button>
        </div>
    )
}
